caption.text:
@rocktape is a great tool to use and can be applied for a variety of purposes including pain, sweeling/inflammation, scar tissue, and postural awareness. ----------------------------------------------------
There are numerous ways to apply tape to an area and this is just one way to help reduce inflammation and decrease pain around the knee. ----------------------------------------------------
It is also important to note that tape along will only do so much, but when tape is combined with education and corrective exercise it can have a profound effect and accelerate the recovery process.
